import React from "react";
import styled from "styled-components";
import UseNavigation from "./UseNavigation";

const Home = () => {

    const handleLinkClick = (url) => {
        if (url !== '사이트') {
            window.open(url, '_blank');
        }
    };

    const { goToHome, goToProfile, goToProject, goToContact } = UseNavigation();

    return (
        <>
            <BackgroundImage>
                <BackArea>
                    <BackBorder>
                        <BackColor>
                            <BoardBind>
                                <Left>

                                    {/* <LeftTop>TODAY <VisitCount>11</VisitCount> | TOTAL 1113</LeftTop> */}

                                    {/* <LeftTopFlex> */}


                                    {/* <LeftTop>
                                        <LeftTopFlex>

                                            Today
                                            <VisitCount>11</VisitCount>

                                            | TOTAL 1113

                                        </LeftTopFlex>
                                    </LeftTop> */}


                                    {/* </LeftTopFlex> */}

                                    <TextLeftFlex>
                                        sdasdadasdasdasdasdasdasdsd
                                    </TextLeftFlex>










                                    {/* 수정 글씨 반응형 */}
                                    {/* <LeftProfile>
                                        <LeftProfileImage src="/background/Picture.png" alt="profile" />
                                    </LeftProfile>
                                    <LeftInfoTitle>
                                        Introduce
                                    </LeftInfoTitle>
                                    <LeftInfo>
                                        프론트엔드 개발자를 꿈꾸는 이재호입니다.<br />
                                        사용자 경험을 고려한 직관적이고 효율적인 인터페이스를 디자인하고 개발하는 것에 관심이 많습니다. <br />
                                    </LeftInfo>
                                    <LeftLinkTitle>
                                        Link
                                    </LeftLinkTitle>
                                    <LeftLink>
                                        <LeftLinkSelect onChange={(e) => handleLinkClick(e.target.value)}>
                                            <option value="사이트">깃허브 및 블로그</option>
                                            <option>https://github.com/jaeho13</option>
                                            <option>https://velog.io/@jaehooo13</option>
                                        </LeftLinkSelect>
                                    </LeftLink> */}
                                </Left>

                                <RightBind>
                                    <Center>
                                        <CenterTop>
                                            <CenterTopSiteFlex>
                                                <CenterTopSite> 이재호의 미니홈피</CenterTopSite>
                                            </CenterTopSiteFlex>
                                            <CenterTopLinkFlex>
                                                <CenterTopLink>
                                                    <a href="https://jaeho13.github.io">https://jaeho13.github.io</a>
                                                </CenterTopLink>
                                            </CenterTopLinkFlex>
                                        </CenterTop>
                                        <CenterCommitState>
                                            Commit States
                                        </CenterCommitState>
                                        <CenterCommitImage>
                                            <CenterCommitImageArea src="https://ghchart.rshah.org/jaeho13" />
                                        </CenterCommitImage>
                                        <CenterMiniroom>
                                            Miniroom
                                        </CenterMiniroom>
                                        <CenterMiniroomImage>
                                            <CenterMiniroomImageArea src="/background/study.png" alt="study" />
                                        </CenterMiniroomImage>
                                    </Center>

                                    <Right>
                                        <RightHomeFlex>
                                            <RightHome onClick={goToHome} >Home</RightHome>
                                        </RightHomeFlex>

                                        <RightProfileFlex>
                                            <RightProfile onClick={goToProfile} >Profile</RightProfile>
                                        </RightProfileFlex>

                                        <RightProjectFlex>
                                            <RightProject onClick={goToProject} >Project</RightProject>
                                        </RightProjectFlex>

                                        <RightContactFlex>
                                            <RightContact onClick={goToContact} >Contact</RightContact>
                                        </RightContactFlex>
                                    </Right>
                                </RightBind>
                            </BoardBind>
                        </BackColor>
                    </BackBorder>
                </BackArea>
            </BackgroundImage>
        </>
    );
};

export default Home;

const BackgroundImage = styled.div`
    background-color: #a3a3a3;
    background-image: url(/background/pattern.png);
    background-size: 100px;
    position: fixed;
    left: 0;
    top: 0;
    right: 0;
    bottom: 0;
    display: flex;
    justify-content: center;
    align-items: center;
`

const BackArea = styled.div`
    width: 70%;
    height: 85vh;
    border: 2px solid #738186;
    border-radius: 30px;
    background-color: #b4d1da;
    display: flex;
    justify-content: center;
    align-items: center;
`

const BackBorder = styled.div`
    width: 97%;
    height: 80vh;
    border: 3.5px dashed white;
    border-radius: 15px;
    display: flex;
    justify-content: center;
